import React from 'react';
import './home.css';
import Carousel from '../Carousel/Carousel';


import tifa from '../images/tifa.jpg';
import aerith from '../images/aerith.jpg';
import dd3 from '../images/dd3.jpg';

export default function Home() {

    const images = [tifa, aerith];
  return (
    <div className="py-5 bg-light d-flex flex-column align-items-center">

              <div className="container-sm px-4 d-flex">
                <div className="row">
                    <h2>Game Art</h2>
                    <Carousel images={images} />
                </div>
                <article>
                  <h2>Blog</h2>
                  <p>Dragon's Dogma</p>
                  <img src={dd3} alt='DD2 img' />
                  <p>

                  Embark on an epic journey through the realms of Middle-earth, where every step echoes with the pulse of adventure. In this immersive open-world experience, you'll traverse stunning landscapes teeming with life and magic, just like in the pages of "The Lord of the Rings." Engage in thrilling battles against goblins and other foes straight out of your favorite movie scenes, and assemble a formidable team to aid you on your quest. With the enigmatic presence of a Gandalf-like figure at your side, each moment brims with the promise of wizardry and wonder. As day fades into night, a new realm of mystery unfolds, offering a fresh challenge with every passing hour. Dive into the heart-pounding combat, where skill and strategy unlock untold rewards, and experience the magic of Middle-earth like never before.</p>
                </article>
            </div>            
    </div>
  )
}
